import axios from 'axios';
import React, { useEffect, useState } from 'react'

const List = () => {

  const [list, setlist] = useState();

  useEffect( () => {
    axios.get("http://127.0.0.1:8000/retail/create/")
    .then( (response) => {
      setlist(response.data);
    } )
  }, [] );

  return (
    <div>List</div>
  )
}

export default List
